import React from 'react';
import './research.css';

function Research() {
    return (
        <div>
            <div className="research">
                <div className="research-title">
                    Research
                </div>
                <div className="research-position">
                    Student Researcher
                </div>
                <div classname="research-description">
                    3-D image reconstruction and registration for better detection of artery disease
                </div>
            </div>
        </div>
    )
}

export default Research;
